import React, {
  useState,
  useEffect
} from "react";
import ReactDOM from "react-dom";
import "./index.css";

function AdData() {
  const [data, setData] = useState(null);
  useEffect(() => {
    // fetch(`https://api.github.com/users/facebook`)
   fetch(`https://jf-na-cdn.justfab.com/image/site/en_US/dm/acquisition/feed/justfab/topconvert/jsonTest.json`)
      .then(res => res.json())
      // .then(json => console.log(json))
      .then(setData)
      .catch(console.error);
  }, []);

  if (data) {
    return (
      <div>
     <h1>{ data[0].adid }</h1>

        {/* <img src={data.avatar_url} width={100} /> */}

      </div>
    );
  }
  return null;
}





function TopAdsPage() {
  return <AdData/>;
}

ReactDOM.render(
  <TopAdsPage />,
  document.getElementById("root")
);
